import React from 'react'
import { Card, CardContent, Typography } from '@material-ui/core';
import Chip from '@material-ui/core/Chip'
import { LabelImportant } from '@material-ui/icons';

export default function HobbiesCard() {
    const classes = {
        chips :{
            margin: '1%'
        },
        content : {
            dispay: 'inline-flex',
            maxWidth: '500px'
        }
    }



    const hobbies = ['exercise', 'nutrition', 'reading', 'coffee', 'writing', 'yoga','guitar', 'mediation',
                'programming', 'piano', 'deep reflections', 'learning', 'building/creating', 'playing sports',
            'personality tests', 'the flow state', 'music', 'awe-filled experiences']


    return (
        <Card>
            <CardContent>
                <Typography color="textSecondary" variant="h4">
                    Hobbies and Interests
                </Typography>
                <Typography variant="body1" component="p">
                {hobbies.map(label =>{
                    return <Chip label={label} color="primary" style={classes.chips} />
                })
                }
                </Typography>
            </CardContent>
        </Card>
    )
}
